import axios from 'axios'
import {
    Chart as ChartJS,
    RadialLinearScale,
    PointElement,
    LineElement,
    Filler,
    Tooltip,
    Legend,
  } from 'chart.js';
  import { Radar } from 'react-chartjs-2';
  
  ChartJS.register(
    RadialLinearScale,
    PointElement,
    LineElement,
    Filler,
    Tooltip,
    Legend
  );

export default function MarksRadar(){
    const data = {
        lables : ['Stochastic','SDA','OS','Linear','Database'],
        datasets:[{
            label : 'Grades',
            data : [100,70,60,80,70],
            backgroundColor: 'rgba(255, 99, 132, 0.2)',
            borderColor: 'rgba(255, 99, 132, 1)',
            borderWidth: 1,
        }
        ],
    }
    return(
    <>
        <Radar data = {data}/>
    </>
    )
}
